let fullData = [...dt_1, ...dt_2, ...dt_3, ...dt_4];

fullData.forEach((el) => {
  document.querySelector('.container').innerHTML += `<div class="card" id="${el.id}">
            <img class="pr-img"
                src="${el.images[0]}"
                alt="">
            <span class="pr-name">${el.title}</span>
            <span class="pr-price">&#8377;${el.price}</span>
             <a> <span class="pr-about">View details <i     class="ri-arrow-right-line" id="arrow"></i></span></a>
        </div>`;
});

// {/* */}



let launchFrame = (el) => {
  let imageCt = ``;
  el.images.forEach((img) => {
    imageCt += `<img src="${img}" alt="">`;
  });
  console.log(allImg);
  document.querySelector('.product-frame').innerHTML = `<div class="images">
  ${imageCt}
  </div>
  <img src="${el.images[0]}" alt="">
  <div class="pr-details">
  <p class="pr-description">${el.discription}</p>
  <span class="pr-price">&#8377;${el.price}</span>
  <a href="${el.link}">Byu Now</a>
  </div>`
  update();
};


let frame = document.querySelector('.product-frame');
let layer = document.querySelector('.layer')


let allCards = document.querySelectorAll('.card');

allCards.forEach((card) => {
  card.addEventListener('click', () => {
    launchFrame(fullData[card.id - 1]);
    frame.style.display = 'flex';
    layer.style.display = 'block';
  });
});


let allImg;

let update = () => {
  allImg = document.querySelectorAll('.images > img');

  allImg.forEach((i) => {
    i.addEventListener('click', () => {
      console.log(i);
      document.querySelector('.product-frame > img').src = i.src;
    });
  });
}




let closeFrame = () => {
  document.querySelector('.product-frame').style.display = 'none';
  layer.style.display = 'none';
};

layer.addEventListener('click', () => {
    console.log('clicked');
  closeFrame();
});
